window.bookSummaryJSON = "<p>The first mission to Europa – Jupiter's enigmatic moon – has landed, and humanity’s darkest fears are about to awaken.</p> <p>For years, mankind has speculated that this frozen world harbours a hidden ocean twice the size of all Earth’s oceans combined – an ocean potentially teeming with life.</p> <p>Driven by this tantalising mystery, they venture forth to unlock its secrets. But what they discover in the abyssal depths is far beyond anything they could have imagined.</p> <p>Nearly 400 million miles from Earth, their search for life has succeeded. But in their triumph, they overlook the most terrifying truth: what they have found is something far older and more horrifying than they ever could have conceived. Something has been trapped in the dark for eons – watching, and waiting, for them.</p> <p>Now, the crew stands at the threshold of unimaginable terror, realising too late that Hell, in its purest form, is cold.</p>"; 
